    int i, j, k;
    int count = 0;
    for(i = 0; i < numsSize - 2; i++){
        for(j = i + 1; j < numsSize - 1; j++){
            for(k = j + 1; k < numsSize; k++){
                if(nums[j] - nums[i] == nums[k] - nums[j]){
                    count++;
                }
            }
        }
    }
    return count;
}

